import { ActionType } from "../constent/action-type";

const initialState = {
    products: [
        {
            id: 11,
            name: 'junaid',
            age: 20
        }
    ]
}
export const productReducer = (state, { type, payload }) => {
    switch (type) {
        case ActionType.Set_PRODUCTS:
            return state

        default:
            return state
    }
}
